(17, 'nashik', 'Nashik is located in the north-west of Maharashtra near Gujarat state, 171 km (106 mi) from Mumbai and 210 km (130 mi) from Pune and is the administrative headquarters of the Nashik District and Nashik Division. With a population of 1.9 million, Nasik is the third largest city in Maharashtra after Mumbai and Pune. In terms of area it is second largest city behind Mumbai.[4][5] and Nashik district is the eleventh most populous district in India. Mumbai, Pune and Nashik are known as golden triangle in Maharashtra.\r\nNashik is said to be the abode of Lord Rama during his 14 years in exile here. It is located on the banks of the Godavari which originates in the south-west of the city at Trimbakeshwar. It is one of the four places in the world where the Kumbh Mela is held making it one of the holiest Hindu cities. The city is a site for more than 100 ancient temples including the Kalaram Temple and Trimbakeshwar Shiva Temple.\r\nThe Anjaneri (or Anjneri) mountain, located 7 km from Trimbakeshwar in the Nasik district, is also claimed as the birthplace of Hanuman.\r\nNashik ranks 16th in a global study of fastest developing city conducted by The City Mayors Foundation, an international think tank on urban affairs and has witnessed significant economic progress in the last decade. The Delhi Mumbai Industrial Corridor (DMIC) project has earmarked the Sinnar and Igatpuri regions of Nashik district as a region for development of dedicated freight coridoors. The city is also known as the Wine Capital of India since it accounts to a large amount of the country''s grape export and there are many vineyards in and around Nashik. It also plays an utmost important role in agriculture. Onion, tomatoes and many other vegetables are exported from Nashik to various parts of the world. In addition, Nashik is known for its picturesque surroundings, climate and tourism.', '2015-04-18', ' Car Rental Services Nasik| Nasik car hire with lowest fare-dial2hire', 'Nasik Car Rental Services for local, outstation at lowest fare.Car hire Nasik,Rent a car in Nasik,taxi in Nasik, cab/car Hire  in Nasik at cheapest rates\r\n', 'Nasik Car Rental Services for local,car hire at lowest fare.Car hire Nasik,Rent a car in Nasik,taxi in Nasik,cab/car Hire  in Nasik at cheapest rates, Car Rental Services Nasik', '', ''),
