(19, 'Guntur', 'located 40 miles (64 km) to the north of the Bay of Bengal, is a city and a municipal corporation in India. It is the administrative capital of Guntur district which falls under the Andhra Pradesh Capital Region. It is the third most populous city in the state with a population of 651,382. In the year 2012, the city limits were expanded by merging ten surrounding villages into the municipal corporation and the regional urban population is 743,354. The city is also a part of Andhra Pradesh Capital Region.\r\n\r\nThe city region is the center for education and the home for historical spots such as Amaravati, Undavalli caves, Kondavid Fort and Sitanagaram monuments. The city is also a centre for business, e-commerce industry, and agriculture. The region is identified as a major industrial region in India along the corridor up to Visakhapatnam. The city is famous for its exports, including chillies, cotton, and tobacco. It is the largest producer of spice(chilies) in India.', '2015-04-21', 'Car Rental Guntur | Guntur Taxi Services| Cab Hire Guntur -Dial2hire', 'Best and reliable for Car Rental Guntur, Guntur taxi services, Cab Hire Guntur and tempo truck services  with Best fares- Dial2hire.com.', 'Car Rental Guntur, cab rental, Guntur Car Rental, car hire Guntur, Car on rent, taxi service Guntur, tempo hire Guntur, Truck Hire, airport car rental in Guntur, cheap car hire Guntur, online cab booking in Guntur, Best Taxi service', '', '<meta property="og:url" content="http://dial2hire.com/car-rentals/guntur"/>\r\n\r\n <meta property="og:title" content="Car Rental Guntur | Guntur Taxi Services| Cab Hire Guntur -Dial2hire"/>\r\n\r\n<meta property="og: description” content=“ Best and reliable for Car Rental Guntur, Guntur taxi services, Cab Hire Guntur and tempo truck services  with Best fares -Dial2hire.com.”/>\r\n\r\n<meta name="keyphrase" content="Car Rental Guntur, cab rental, Guntur Car Rental, car hire Guntur, Car on rent, taxi service Guntur, Guntur Ta