(21, 'jaipur', 'Jaipur is the famous city and capital of Rajasthan. It was founded on 18 November 1727 by Maharaja Sawai Jai Singh II, the ruler of Amber, after whom the city has been named. Jaipur is known as the pink city. It is a very prominent city in Rajasthan and India from the tourist perspective. Historically Jaipur (also known as Jeypore) has been a tourist attraction because of its rich culture. The culture here includes traditional palaces that were once inhabited by Royal families. Jaipur used to be a major Tourist attraction for foreigners who came to India to see the Architecture of Jaipur as described by Magazines and portrayed in movies and documentaries. Today Jaipur is a very different city unlike what it was before the ‘90’s owing to the rapid urban development in Rajasthan. The populations studies show that at present, more than 5 million people inhabit Jaipur. The city has a romantic charm. Jaipur today has many stores that are home to both local and international brands selling Jewelry, Shoes, Clothes and Fashion accessories. \r\nDial2hire.com Role	\r\nHire a car; Hire a Taxi, and Hire Auto- Rickshaw, Hire Truck, Hire Tempo from dial2hire.com.Call 8689890808.\r\nPlaces to visit in Jaipur: Akshardham Temple Birla Mandir which is built completely of white marble. Jain Mandir Gardens, Zoological Garden, Sisodia Rani Palace Ka Bagh, Ram Niwas Garden, Vidyadhar Garden Historical Sites, City Palace, a beautiful palace surrounded by large walls on all sides. Hawa Mahal, built by Sawai Pratap Singh in 1799. Amber Palace which played a key role in the history of Medieval India. Ridhi Sidhi Pol named after Lord Ganesha and his consorts, Ridhi and Sidhi. Chand Pol is one of the famous architectural structures built according to the traditional Vastu ideology. Amber Fort, Jaigarh Fort which is generally called as the fort of victory. Nahargarh Fort which is constructed by Sawai Man Singh. ', '2015-04-21', 'Car Rental Jaipur | Jaipur Taxi Services| Cab Hire